/*
CREATE TABLE AGG_CAMPAIGN_RPTG (
	CAMPAIGN_ID VARCHAR2(256),
	CAMPAIGN_ITEM_ID VARCHAR2(256),
	MEDIA_ASSET_ID NUMBER NOT NULL,
	OPERATOR VARCHAR2(64) NOT NULL,
	SERVICE_GROUP VARCHAR2(64) NOT NULL,
	DATE_HOUR DATE,
	INSERT_COUNT NUMBER,
	VIEW_COUNT NUMBER
) */


CREATE TABLE CAMPAIGN (
	ID NUMBER(9,0) NOT NULL,
	NAME VARCHAR2(255) NOT NULL,
	PROGRAMMER_ID NUMBER(7,0) NOT NULL,
	ORDER_ID VARCHAR2(50),
	TYPE_CODE VARCHAR2(8) NOT NULL,
	STATUSCODE VARCHAR2(8) NOT NULL,
	GOALTYPE VARCHAR2(8) NOT NULL,
	START_DATE TIMESTAMP(6)(0) NOT NULL,
	FINAL_DATE TIMESTAMP(6)(0) NOT NULL,
	DESCRIPTION VARCHAR2(255)
);

CREATE TABLE CAMPAIGN_ITEM (
	ID NUMBER(9,0) NOT NULL,
	CAMPAIGN_ID NUMBER(9,0) NOT NULL,
	START_DATE TIMESTAMP(6)(0) NOT NULL,
	FINAL_DATE TIMESTAMP(6)(0) NOT NULL,
	ACTIVE NUMBER(1) NOT NULL,
	TRICKMODE NUMBER(1) NOT NULL,
	CATEGORY_ID NUMBER(9,0) NOT NULL,
	CATEGORY_EXCLUSION NUMBER(1) NOT NULL,
	CATEGORYEXCLUSIONSCOPE VARCHAR2(8),
	PRIORITY NUMBER(38) NOT NULL,
	VALUE NUMBER(38) NOT NULL,
	STRATEGY VARCHAR2(8) NOT NULL,
	GOAL NUMBER(38)
)
GO
CREATE TABLE NETWORK (
	ID NUMBER NOT NULL,
	PROGRAMMER_ID NUMBER NOT NULL,
	NAME VARCHAR2(32) NOT NULL
)
GO
CREATE TABLE OPERATOR (
	ID NUMBER NOT NULL,
	COMPANY_NAME VARCHAR2(64) NOT NULL
)
GO
CREATE TABLE PROGRAMMER (
	ID NUMBER(9,0) NOT NULL,
	NAME VARCHAR2(64) NOT NULL,
	SHORT_NAME VARCHAR2(64) NOT NULL
)
GO
CREATE TABLE PROVIDER (
	ID VARCHAR2(64) NOT NULL,
	ACTIVE NUMBER(1) NOT NULL
)
GO
CREATE TABLE PROVIDER_NETWORK (
	PROVIDER_ID VARCHAR2(64) NOT NULL,
	NETWORK_ID NUMBER(9,0) NOT NULL
)
GO
CREATE TABLE VOD_ENDPOINT (
	ID NUMBER(9,0) NOT NULL,
	URL VARCHAR2(255) NOT NULL,
	IDENTITY VARCHAR2(255) NOT NULL,
	OPERATOR_ID NUMBER(9,0),
	ACTIVE NUMBER(1) NOT NULL,
	TYPE_DISCRIMINATOR VARCHAR2(8) NOT NULL,
	STATUS_CHECK_TYPE VARCHAR2(8),
	OPERATOR_CIS_ID NUMBER(9,0),
	NAME_QUALIFIER VARCHAR2(255),
	SERVICE_NAME VARCHAR2(48),
	PORT_NAME VARCHAR2(48),
	AUTH VARCHAR2(128),
	PARENT_ADM_ID NUMBER(9,0),
	PLACEMENT_ADSENDPOINT_ID NUMBER(9,0),
	PSN_ADSENDPOINT_ID NUMBER(9,0),
	DEREG_ADSENDPOINT_ID NUMBER(9,0),
	SSN_ADSENDPOINT_ID NUMBER(9,0),
	DEFAULT_ADSENDPOINT_ID NUMBER(9,0),
	SCR_ADSENDPOINT_ID NUMBER(9,0)
)
GO
